import './App.css';
import Header from './Header';
import React from 'react';

function App() {
  return (
    <div className="App" >
      <header className="header" style={{ 
      display: 'flex', 
      alignItems: 'right', 
     //justifyContent: 'flex-start', 
      padding: '1px',
    }}>
      <img src="JSA Logo.png" alt="Japanese Student Association Logo" 
      style={{ 
        maxWidth: '100px', 
        maxHeight: '50px', 
        marginRight: '700px', 
        marginTop: '10px', 
        justifyContent: 'flex-start' 
    }} />
       <h1>Japanese Student Association</h1>
        </header>
    </div>
  );
}

export default App;
